import React, {useEffect, useState} from 'react';
import './App.css';
import axios from 'axios';


function Conversion2 (props) {
  useEffect(()=>{
    let userId = localStorage.getItem("cri_genetics_userId")
    let sessionId = sessionStorage.getItem("cri_genetics_sessionId")
    if(userId){
      axios.post('/addConversion', {url:window.location.href, userId, sessionId})
    }
  }, [])

  return (
    <div>
      Thank you for buying WidgetA!
    </div>
  )
}

export default Conversion2;
